import React, { useContext } from 'react';
import { AuthContext } from '../../contexts/AuthContext';
import { Link, useNavigate, useParams} from 'react-router-dom';
import "./Profile.css";

const Profile = () => {

    const {username} = useParams();

    return (
        <div>
                <p>{username}</p>
        </div>
    );
}
 
export default Profile;
